var handleDataTableButtons = function () {
    "use strict";
    0 !== $("#data-table").length && $("#data-table").DataTable({
        dom: "Bfrtip",
        buttons: [{extend: "copy", className: "btn-sm"}, {extend: "csv", className: "btn-sm"}, {
            extend: "excel",
            className: "btn-sm"
        }, {extend: "pdf", className: "btn-sm"}, {extend: "print", className: "btn-sm"}],
        responsive: !0
    }),
    0 !== $("#data-table-list").length && $("#data-table-list").DataTable({
        dom: "lBfrtip",
        buttons: [{
            extend: "copy", className: "btn-sm", exportOptions: {
                columns: ':not(.notexport)'
            }
        }, {
            extend: "csv", className: "btn-sm", exportOptions: {
                columns: ':not(.notexport)'
            }
        }, {
            extend: "excel",
            className: "btn-sm",
            exportOptions: {
                columns: ':not(.notexport)'
            }
        }, {
            extend: "pdf", className: "btn-sm", exportOptions: {
                columns: ':not(.notexport)'
            }
        }, {
            extend: "print", className: "btn-sm", exportOptions: {
                columns: ':not(.notexport)'
            }
        }],
        // responsive: !0,
        // autoFill: !0,
        colReorder: !0,
        // keys: !0,
        // rowReorder: !0,
        select: !0,
        scrollX: !0
    })
}, TableManageButtons = function () {
    "use strict";
    return {
        init: function () {
            handleDataTableButtons()
        }
    }
}();